import React from "react";
import './style.css';

const Card = (props) =>{
    return(
        <div className="container mt-2">
        <div className="card bg-dark text-white">
                <h5 className="card-title">{props.title}</h5>
                <img src={props.image} alt=""/>
                <p className="card-text">{props.calories}</p>
            
        </div>
    </div>
    );
}

export default Card
